function getEvents(n,t,i,r){"use strict";$.get({url:"http://localhost:8000/api/classes/range/"+(n.format("YYYY-MM-DD")+"/"+t.format("YYYY-MM-DD")),success:function(n){r(n.map(classToEvent))}})}function eventClicked(n){"use strict";$.get({url:"http://localhost:8000/api/classes/id/"+n.id,async:!0,success:function(n){$("#classTitle").text(n.subjectName);$("#classType").text(n.type);$("#classTime").text(moment.utc(n.dateTime).format("DD.MM.YYYY, dddd, HH:mm"));$("#classInfoModal").modal("show")}})}function classToEvent(n){"use strict";return{id:n.id,title:n.subjectName+": "+n.type,start:moment.utc(n.dateTime).format(),end:moment.utc(n.dateTime).add(1,"hours").add(20,"minutes").format()}}$(document).ready(function(){$("#calendar").fullCalendar({allDaySlot:!1,defaultView:"agendaWeek",eventClick:eventClicked,eventColor:"#0275D8",events:getEvents,weekends:!1,weekNumbers:!0});$("#calendar").fullCalendar("option","height","auto");$("#calendar").fullCalendar("option","minTime","08:00:00");$("#calendar").fullCalendar("option","maxTime","21:00:00")});